import React from 'react'

export default class Games extends React.Component{
    render() {
        return(
            <>
            <h1>Games</h1>
            <br/>
            <h2>
                Games will be coming soon....<br/>
                for now you can join roblox
            </h2>
            <a href="https://www.roblox.com">here!</a>
            </>
        )
    }
}
